import './coverStyle.css';

export const Cover = () => {
    return (
        <div className='cover'>
            <h1>CHASTITY BELT</h1>
            <img src='images/album_cover.jpg' alt='album cover' />
            <p>Self-titled album out now on Hardly Art</p>
            <a href='https://ffm.to/chazzy' target='_blank' rel='noopener noreferrer'>Listen</a>
        </div>
    );
};
